{"id": "1008558", "question": "Mình tên là Tô Văn Chính đang ở tại 6/2A Lý Nam Đế, Phường Phù Đổng, TP Pleiku, Gia Lai      1- Vinaphone:(1) 0941 772 146; (2) 01292 103 371; (3) 0947 136 001; (4) 0947 116 002      Mình đang dùng 2 điện thoại Samsung Galaxy J5 2015 và Samsung Galaxy J7 2015, mỗi máy có 2 khe sim.       Mình nhận thấy:      Còn cách trả lời của Thế giới di động trong bài Hướng dẫn gọi video giữa các điện thoại Samsung tên mạng mà mình trích lại sau đây là không đúng:            II- Mình dùng điện thoại Galaxy J5, J7 2015 nên mình thấy hướng dẫn thao tác chọn sim dùng cho cuộc gọi video ngày 25/11/2015 của Thế giới di động có khác với các bước thao tác trên điện thoại của mình. Nhưng các bạn cần nắm vững nguyên tắc để gọi được video call như sau:      1- Cả 2 điện thoại gọi đi và đến đều có cấu hình thực hiện được cuộc gọi video call như Sam Sung J5, J7…      3- Thuê bao đang hoạt động trong vùng phủ sóng 3G:         Trong vòng phủ sóng 3G là vũng đã được nhà mạng phủ sóng 3G chứ không phải  là điện thoại phải có sóng 3G (không phải bật dữ liệu di động lên).      Cách thực hiện:      Sau đó vào tiếp điểm truy cập (dòng bên trên Chế độ mang), nhấn vào đó, rồi nhấn tiếp vào ô SIM 1, lần lượt chọn:             -  Trường hợp sim Viettel chọn: VIETTEL Email (v-internet)      Chú ý: khi chuyển sim gọi hoặc nhận cuộc gọi thì phải chọn lại mạng 3G cho sim đó như trên.      Khi đáp ứng 5 điều kiện trên thì thực hiện được gọi video call.      1- Nếu điện thoại chỉ lắp 1 sim thì nghe và gọi video call bình thường.      a- Ở vị trí khe sim thứ nhất: nhận và gọi video call bình thường.      Ngoài vòng phủ sóng của 3G      Vậy lỗi này do đâu, do nhà mạng hay do điện thoại?      IV- Để phát hiện lỗi cuộc gọi không thực hiện được do sim, hay do điện thoại, tránh nhầm lẫn khi chọn sim, sai sót do chưa chọn mạng 3G cho sim, mình đã thực hiện như sau:      J5: sim 1: 0947136001; sim 2: 01291103371.      2- Thực hiện từng cuộc gọi thoại, video call từ từng số điện thoại của điện thoại J7 sang từng số điện thoại của điện thoại J5 và ngược lại, ghi kết quả từng cuộc gọi ra giấy:, gọi được ghi có, không gọi được ghi 0. Mỗi khi chuyển cuộc gọi từ sim này sang sim khác, mình phải chuyển chế độ sim đó sang 3G hoặc 3G/2G hoặc WCDMA/GMS.      J5: sim 1: 0941772146; sim 2: 0947116002      Qua nhiều lần thực nghiệm trên cả 2 mạng Vinaphone và Viettel, mình đều có kết quả như phần III.      Rất mong Thế giới di động quan tâm, nhanh chóng trả lời!                  \r\n\r\n                \r\n                \r\nVề việc  gọi video giữa các điện thoại Samsung  không cần internet.      Gửi Thế giới di động và bạn đọc gần xa!"}
